.hosptial_bg {
    height: 500px;
    width: 100%;
    img {
        height: 100%;
        width: 100%;
    }
}

.hosptial {
    width: 80%;
    margin: auto;
    margin-top: 1rem;
    display: flex;

    .hosptial_bg2 {
        width: 50%;
        display: flex;
        justify-content: center;
        align-items: center;

        img {
            height: 100%;
            width: 100%;
        }
    }

    .hosptial_keyword {
        width: 40%;
        display: flex;
        flex-direction: column;
        justify-content: center;
        padding-left: 10%;

        .hosptial_keywords {
            display: flex;
            height: 13%;
            width: 100%;
            text-align: left;
            font-size: 1.3rem;
        }

        .hosptial_keyword_img {
            width: 10%;
            display: flex;
            align-items: center;
        }

        .hosptial_keyword_text {
            width: 80%;
            display: flex;
            align-items: center;
        }
    }
}

.hosptial_honor {
    margin-top: 1rem;

    .hosptial_honor_title {
        text-align: center;
    }

    .hosptial_honor_img {
        display: flex;
        flex-wrap: wrap;
        margin-top: 1rem;
       .hosptial_honor_imgs {
        width: 25%;
        height: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        margin-bottom: 2rem;
            img {
                height: 70%;
                width: 50%;
            }
        }
    }
}

.hosptial_environment {
    margin-top: 1rem;

    .hosptial_environment_title {
        text-align: center;
    }

    .hosptial_environment_img {
        margin: auto;
        height: 300px;
        width: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        margin-top: 1rem;

        .hosptial_show {
            height: 300px;
            width: 100%;

            img {
                width: 100%;
                height: 100%;
                object-fit: cover;
            }
        }
    }
}

.hosptial_service {
    margin-top: 2rem;

    .hosptial_service_title {
        text-align: center;
    }

    .hosptial_service_body {
        display: flex;
        flex-wrap: wrap;
        width: 80%;
        margin: auto;

        .hosptial_service_body_item {
            height: 130px;
            width: 20%;
            margin-right: 5%;
            margin-top: 2rem;
            background-image: url(/img/hosptial_service_bg.png);
            background-size: 100% 100%;
            background-repeat: no-repeat;
            display: flex;
            justify-content: center;
            align-items: center;
            color: #721b0e;
            font-size: 2rem;

            &:hover {
                color: white;
                background-color: #721b0e;
            }
        }
    }

}

.hosptial_target_body {
    display: flex;
    flex-wrap: wrap;
    width: 80%;
    margin: auto;
    height: 250px;
    margin-top: 3rem;

    .hosptial_target_body_item {
        height: 130px;
        width: 20%;
        margin-right: 5%;
        margin-top: 2rem;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;

        .hosptial_target_body_item1 {
            display: flex;
            justify-content: center;
            align-items: center;
            margin-top: 1rem;
        }

        .hosptial_target_body_item2 {
            color: #721b0e;
            text-transform: capitalize;
            margin-top: 1rem;
            font-size: 1.5rem;
        }

        .hosptial_target_body_item3 {
            margin-top: 0.5rem;
            margin-bottom: 0.5rem;
            font-size: 2rem;
        }

        .hosptial_target_body_item4,
        .hosptial_target_body_item5 {
            font-size: 1.3rem;
        }

    }
}

.hosptial_swiper {
    margin: auto;
    margin-bottom: 2rem;
    width: 80%;
    height: 20%;

    img {
        height: 100%;
        width: 100%;
    }
}
